import React, { Component } from 'react';
import {Row, Col} from 'react-bootstrap';
import './Contact.css';


export default class Contact extends Component {
   constructor(props) {
      super(props);
   }
   render() {
      console.log("Redrawing Contact Us Page");
      return (
         <div className='contactUs'>           
				<img src={process.env.PUBLIC_URL + '/images/ContactUs.jpeg'} className='joinUsImg'/>
            <div className="centered">
               Contact Us
            </div>
            <h1 style={{paddingTop: '50px', paddingBottom: '50px'}}>2020 Membership Information</h1>

            <div class="row">
               <Col>
                  <h2>(123)-456-7890</h2>
                  <p>Monday-Saturday</p>
                  <p>2:30PM - 5:30PM</p>
               </Col>
               <Col>

               </Col>
               <Col>
                  <h2>The Pegasus School</h2>
                  <p>19692 Lexington Ln, Huntington Beach, CA 92646</p>
               </Col>
               <Col>
                  <div className='container'>
                     <ul className="contactUs_social_media">
                        <li><a href="http://facebook.com"><i className="fab fa-facebook-f"></i></a></li>
                        <li><a href="http://twitter.com"><i className="fab fa-twitter"></i></a></li>
                        <li><a href="http://linkedin.com"><i className="fab fa-linkedin"></i></a></li>
                        <li><a href="http://instagram.com"><i className="fab fa-instagram"></i></a></li>
                     </ul>
                  </div>
               </Col>
            </div>
         </div>

      )
   }
}
